exampleQueries._updateQueryString:
{[dgAdd;dgUpd;dgDel]

  /this sample requires keyed table, table's key matches 'Key' in this dialog
  /exampleQueries:: `id xkey ([] id:`int$();name:`symbol$();note1:`symbol$());
  /`exampleQueries upsert(0i;`dummy;`);

    $[((count dgUpd)>0);`exampleQueries upsert flip dgUpd;];
    $[((count dgDel)>0);delete from `exampleQueries where id in (dgDel[`id]);];

    /generate unique ids for new items
    $[((count dgAdd)>0);`exampleQueries upsert flip dgAdd;];
}

