CountyProperties._queryString:
{[bounds]
	t: `address xdesc select address, sale_date, month: sale_date.month  ,year, county,  postal_code, price, description_of_property, date, latitude, longitude, geo_county, region
	from ppr 
	where (year = `2017) &
	(latitude > "F" $string bounds[0]) &
  (longitude > "F" $string bounds[1]) &
  (latitude < "F" $string bounds[2]) &
  (longitude < "F" $string bounds[3]);


	minPrice: exec min(price) from t;
  maxPrice: exec max(price) from t; 

	t:select address, sale_date, month: sale_date.month  ,year, county,  postal_code, price, description_of_property, date, latitude, longitude, geo_county, region, percent: ((price - minPrice) * 100) %(maxPrice - minPrice) from t;


	 select address, sale_date, month: sale_date.month  ,year, county,  postal_code, price, description_of_property, date, latitude, longitude, geo_county, region, percent,
	 color:?[percent<=10;`$"#db4838";?[percent<=20;`$"#db6431";?[percent<=30;`$"#d98c27";?[percent<=40;`$"#d5ab23";?[percent<=50;`$"#acc21c";?[percent<=60;`$"#9ac41c";?[percent<=70;`$"#2eb31d";?[percent<=70;`$"#1aad21";?[percent<=80;`$"#11a63b";?[percent<=90;`$"#11a63b";`$"#10a154"]] ] ] ] ] ] ]  ] ] ,
		priceRange:?[price<=100000;`$"under 100K";?[price<=200000;`$"100K-200K";?[price<=300000;`$"200K-300K";?[price<=400000;`$"300K-400K";?[price<=500000;`$"400K-500K";?[price<=600000;`$"500K-600K";?[price<=700000;`$"600K-700K";`$"700k+"]] ] ] ] ] ]  

		from t
	}

regionBkVS._virtualQueryString:
function (source, callback) {

   var res = {
       columns: [  "min",  "max",  "avg" ],
       meta:{ "min": 9,  "max": 9,  "avg": 9},
       rows: [{
           min: _.minBy(source.rows, "price").price,
           max: _.maxBy(source.rows, "price").price,
           mean: _.meanBy(source.rows, "price"),
           count: source.rows.length
       }]
   };

    callback(res);

}

